   if(!isAuthenticated){
    f=false
   }
   if(isAuthenticated&&f){

    setName(user.name);
    f=true;
   }



  return (
    <Fragment>

  <BrowserRouter>
     <CartContextProvider cartname={cartname}>
      <App  />
    </CartContextProvider>
  </BrowserRouter>
    </Fragment>
  )
}

export default E;
